(2, 8, 'History of ISKCON', 'History of ISKCON'),
(2, 9, ':history-of-iskcon-iskcon-lotus-temple-nagpur.jpg', 'history-of-iskcon-iskcon-lotus-temple-nagpur.jpg'),
(2, 10, '<p>&quot;International Society for Krishna Consciousness&quot; ISKCON, also popularly known as the Hare Krishna movement is a spiritual society founded by His Divine Grace A.C. Bhaktivedanta Swami Prabhupada in July 1966 in New York. ISKCON belongs to the Gaudiya-Vaishnava sampradaya, a monotheistic tradition within Vedic culture. Today ISKCON comprises of more than 400 temples, 40 rural communities and over 100 vegetarian restaurants. It also conducts special projects throughout the world, such as &quot;Food for Life&quot;, the only free vegetarian relief program in the world.</p>\r\n\r\n<p>The aim of ISKCON is to acquaint all people of the world with universal principles of self-realization and God consciousness so that they may derive the highest benefit of spiritual understanding, unity and peace. The Vedic literature recommend that in the present age of Kali-yuga the most effective means of achieving self-realization is always hear about, glorify, and remember the all-attractive Supreme Lord Sri Krishna. Therefore, it recommends the chanting of the Holy Names: Hare Krishna Hare Krishna Krishna Krishna Hare Hare / Hare Rama Hare Rama Rama Rama Hare Hare. This sublime chanting puts the chanter directly in touch with the Supreme Lord through the sound vibration of His Holy Name.</p>\r\n\r\n<p>ISKCON follows the teachings of the Vedas and Vedic scriptures, including the Bhagavad-gita and Srimad Bhagavatam which teach Vaishnavism or devotion to God (Krishna) in His Supreme Personal aspect of Sri Sri Radha Krishna.</p>\r\n\r\n<p>These teachings are received through the preceptorial line known as the Brahma-Madhav-Gaudiya Vaishnava sampradaya. ISKCON is part of the disciplic succession which started with Lord Krishna Himself and continued with Srila Vyasadeva, Srila Madhavacharya, Sri Caitanya Mahaprabhu and in the present day His Divine Grace A. C. Bhaktivedanta Swami Prabhupada and his followers.</p>\r\n\r\n<p>ISKCON&#39;s teachings are non-sectarian, following the principle of sanatana dharma or eternal religion, which denotes the eternal activity of all living beings &ndash; loving devotional service (bhakti-yoga) to Supreme Personality of Godhead.</p>\r\n\r\n<p>When Srila Prabhupada began the &quot;International Society for Krishna Consciousness ISKCON&quot; (in New York City in 1966), he formulated a clear mission statement. Thus the 7 Purposes of ISKCON are as follows:</p>\r\n\r\n<ol>\r\n	<li>To systematically propagate spiritual knowledge to society at large and to educate all people in the techniques of spiritual life in order to check the imbalance of values in life and to achieve real unity and peace in the world.</li>\r\n	<li>To propagate a consciousness of Krishna (God), as it is revealed in the great scriptures of India, Bhagavad-gita and Srimad-Bhagavatam.</li>\r\n	<li>To bring the members of the Society together with each other and nearer to Krishna, the prime entity, thus developing the idea within the members, and humanity at large, that each soul is part and parcel of the quality of Godhead (Krishna).</li>\r\n	<li>To teach and encourage the sankirtana movement, congregational chanting of the holy name of God, as revealed in the teachings of Lord Sri Caitanya Mahaprabhu.</li>\r\n	<li>To erect for the members and for society at large a holy place of transcendental pastimes dedicated to the personality of Krishna.</li>\r\n	<li>To bring the members closer together for the purpose of teaching a simpler, natural way of life.</li>\r\n	<li>With a view towards achieving the aforementioned purposes, to publish and distribute periodicals, magazines, books and other writings.</li>\r\n</ol>\r\n', '&quot;International Society for Krishna Consciousness&quot; ISKCON, also popularly known as the Hare Krishna movement is a spiritual society founded by His Divine Grace A.C. Bhaktivedanta Swami Prabhupada in July 1966 in New York. ISKCON belongs to the Gaudiya-Vaishnava sampradaya, a monotheistic tradition within Vedic culture. Today ISKCON comprises of more than 400 temples, 40 rural communities and over 100 vegetarian restaurants. It also conducts special projects throughout the world, such as &quot;Food for Life&quot;, the only free vegetarian relief program in the world. The aim of ISKCON is to acquaint all people of the world with universal principles of self-realization and God consciousness so that they may derive the highest benefit of spiritual understanding, unity and peace. The Vedic literature recommend that in the present age of Kali-yuga the most effective means of achieving self-realization is always hear about, glorify, and remember the all-attractive Supreme Lord Sri Krishna. Therefore, it recommends the chanting of the Holy Names: Hare Krishna Hare Krishna Krishna Krishna Hare Hare / Hare Rama Hare Rama Rama Rama Hare Hare. This sublime chanting puts the chanter directly in touch with the Supreme Lord through the sound vibration of His Holy Name. ISKCON follows the teachings of the Vedas and Vedic scriptures, including the Bhagavad-gita and Srimad Bhagavatam which teach Vaishnavism or devotion to God (Krishna) in His Supreme Personal aspect of Sri Sri Radha Krishna. These teachings are received through the preceptorial line known as the Brahma-Madhav-Gaudiya Vaishnava sampradaya. ISKCON is part of the disciplic succession which started with Lord Krishna Himself and continued with Srila Vyasadeva, Srila Madhavacharya, Sri Caitanya Mahaprabhu and in the present day His Divine Grace A. C. Bhaktivedanta Swami Prabhupada and his followers. ISKCON&#039;s teachings are non-sectarian, following the principle of sanatana dharma or eternal religion, which denotes the eternal activity of all living beings – loving devotional service (bhakti-yoga) to Supreme Personality of Godhead. When Srila Prabhupada began the &quot;International Society for Krishna Consciousness ISKCON&quot; (in New York City in 1966), he formulated a clear mission statement. Thus the 7 Purposes of ISKCON are as follows: To systematically propagate spiritual knowledge to society at large and to educate all people in the techniques of spiritual life in order to check the imbalance of values in life and to achieve real unity and peace in the world. To propagate a consciousness of Krishna (God), as it is revealed in the great scriptures of India, Bhagavad-gita and Srimad-Bhagavatam. To bring the members of the Society together with each other and nearer to Krishna, the prime entity, thus developing the idea within the members, and humanity at large, that each soul is part and parcel of the quality of Godhead (Krishna). To teach and encourage the sankirtana movement, congregational chanting of the holy name of God, as revealed in the teachings of Lord Sri Caitanya Mahaprabhu. To erect for the members and for society at large a holy place of transcendental pastimes dedicated to the personality of Krishna. To bring the members closer together for the purpose of teaching a simpler, natural way of life. With a view towards achieving the aforementioned purposes, to publish and distribute periodicals, magazines, books and other writings.'),
(3, 14, 'Our Philosophy', 'Our Philosophy'),
(3, 15, ':iskcon-philosphy-iskcon-lotus-temple.jpg', 'iskcon-philosphy-iskcon-lotus-temple.jpg'),
(3, 16, '<p>The Vedic scriptures state that spiritual life begins when one inquires into the nature of the absolute truth, the Supreme Godhead. Gaudiya Vaisnavas are monotheists and know the personality of Godhead as Krishna, the All-attractive. But it is also recognised that the Supreme has unlimited names such as Rama, Buddha, Vishnu, Jehovah, Allah, etc. The ultimate goal of Gaudiya Vaisnavism is to develop a loving relationship with the Supreme Godhead. To understand knowledge of self-realisation one must approach a genuine spiritual master. The Vedas also tell us that the understanding of the self, as being non-material or spiritual by nature, is the preliminary stage of realisation of the absolute truth. To understand knowledge of self-realisation one must approach a genuine spiritual master, just as one learns the essence of any subject from a perfected practitioner. The congregational chanting of the maha-mantra,</p>\r\n\r\n<h1 style=\"text-align: center;\">Hare Krishna, Hare Krishna, Krishna Krishna, Hare Hare, Hare Rama, Hare Rama, Rama Rama, Hare Hare!</h1>\r\n\r\n<p>as promoted by Sri Caitanya, is accepted by the Vedas as the most effective means of self-purification in this age. The Vedas describe the mantra as a prayer to the Lord, &quot;Please Lord, engage me in Your service&quot;. Devotees may accept formal initiation into the chanting of the Holy Name vowing to abstain from intoxication, gambling, illicit sexual connections and the eating of meat, fish or eggs. ISKCON members believe indulgence in the aforementioned activities disrupts physical, mental and spiritual well-being, and increases anxiety and conflict in society. At the time of initiation devotees also agree to chant a prescribed number of mantras each day.</p>\r\n', 'The Vedic scriptures state that spiritual life begins when one inquires into the nature of the absolute truth, the Supreme Godhead. Gaudiya Vaisnavas are monotheists and know the personality of Godhead as Krishna, the All-attractive. But it is also recognised that the Supreme has unlimited names such as Rama, Buddha, Vishnu, Jehovah, Allah, etc. The ultimate goal of Gaudiya Vaisnavism is to develop a loving relationship with the Supreme Godhead. To understand knowledge of self-realisation one must approach a genuine spiritual master. The Vedas also tell us that the understanding of the self, as being non-material or spiritual by nature, is the preliminary stage of realisation of the absolute truth. To understand knowledge of self-realisation one must approach a genuine spiritual master, just as one learns the essence of any subject from a perfected practitioner. The congregational chanting of the maha-mantra, Hare Krishna, Hare Krishna, Krishna Krishna, Hare Hare, Hare Rama, Hare Rama, Rama Rama, Hare Hare! as promoted by Sri Caitanya, is accepted by the Vedas as the most effective means of self-purification in this age. The Vedas describe the mantra as a prayer to the Lord, &quot;Please Lord, engage me in Your service&quot;. Devotees may accept formal initiation into the chanting of the Holy Name vowing to abstain from intoxication, gambling, illicit sexual connections and the eating of meat, fish or eggs. ISKCON members believe indulgence in the aforementioned activities disrupts physical, mental and spiritual well-being, and increases anxiety and conflict in society. At the time of initiation devotees also agree to chant a prescribed number of mantras each day.'),
(4, 17, 'Who is Srila Prabhupada?', 'Who is Srila Prabhupada?'),
(4, 18, ':srila-prabhupada-iskcon-lotus-temple.png', 'srila-prabhupada-iskcon-lotus-temple.png'),
(4, 19, '<h3 style=\"text-align: center;\">He was a genuine holy person with enormous integrity and compassion, and he had a powerful impact on those who met him. He never claimed authority and respect for himself; what he said and did was always in the name of Krishna&hellip;</h3>\r\n\r\n<div style=\"text-align: center;\">&ndash; Dr. Thomas J. Hopkins</div>\r\n\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n\r\n<div>When His Divine Grace A.C. Bhaktivedanta Swami Srila Prabhupada entered the port of New York City on September 17, 1965, few Americans took notice &mdash; but he was not merely another immigrant. He was on a mission to introduce an ancient religion, which originated in India, into mainstream America. Before Srila Prabhupada passed away on November 14, 1977, at the age of 81, his mission proved successful. He had founded the International Society for Krishna Consciousness (ISKCON) and saw it grow into a worldwide confederation of more than 100 temples, ashrams and cultural centers.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Srila Prabhupada was born Abhay Charan De on September 1, 1896, to a pious Hindu family in Calcutta. As a youth growing up in British-controlled India, Abhay became involved with Mahatma Gandhi&#39;s civil disobedience movement to secure independence for his nation. It was, however, a 1922 meeting with a prominent scholar and religious leader, Srila Bhaktisiddhanta Sarasvati, which proved most influential on Abhay&#39;s future calling. Srila Bhaktisiddhanta was a leader in the Gaudiya Vaishnava denomination, a monotheistic tradition within the broad Hindu culture, and asked Abhay to bring the teachings of Lord Krishna to the English-speaking world. Abhay became a disciple of Srila Bhaktisiddhanta in 1933, and resolved to carry out his mentor&#39;s request. Abhay, later known by the honorific A.C. Bhaktivedanta Swami Prabhupada, spent the next 32 years preparing for his journey to west.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>In 1965, at the age of sixty-nine, Srila Prabhupada travelled to New York City aboard a cargo ship. The journey was treacherous, and the elderly spiritual teacher suffered two heart attacks aboard ship. Arriving in the United States with just seven dollars in Indian rupees and his translations of sacred Sanskrit texts, Srila Prabhupada began to share the timeless wisdom of Krishna consciousness. His message of peace and goodwill resonated with many young people, some of whom came forward to become serious students of the Krishna tradition. With the help of these students, Srila Prabhupada rented a small storefront on New York&#39;s Lower East Side to use as a temple. On July 11, 1966, he officially registered his organization in the state of New York, formally founding the International Society for Krishna Consciousness. In the eleven years that followed, Srila Prabhupada circled the globe 14 times on lecture tours, bringing the teachings of Lord Krishna to thousands of people on six continents. Men and women from all backgrounds and walks of life came forward to accept his message, and with their help, Srila Prabhupada established ISKCON centers and projects throughout the world. Under his inspiration, Krishna devotees established temples, rural communities, educational institutions, and started what would become the world&#39;s largest vegetarian food relief program. With the desire to nourish the roots of Krishna consciousness in its home, Srila Prabhupada returned to India several times, where he sparked a revival in the Vaishnava tradition. In India, he opened dozens of temples, including large centers in the holy towns of Vrindavana and Mayapur.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Srila Prabhupada&#39;s most significant contributions, perhaps, are his books. He authored over 70 volumes on the Krishna tradition, which are highly respected by scholars for their authority, depth, fidelity to the tradition, and clarity. Several of his works are used as textbooks in numerous college courses. His writings have been translated into 76 languages. His most prominent works include: Bhagavad-gita As It Is, the 30-volume Srimad-Bhagavatam, and the 17-volume Sri Chaitanya-charitamrita.</div>\r\n', 'He was a genuine holy person with enormous integrity and compassion, and he had a powerful impact on those who met him. He never claimed authority and respect for himself; what he said and did was always in the name of Krishna… – Dr. Thomas J. Hopkins   When His Divine Grace A.C. Bhaktivedanta Swami Srila Prabhupada entered the port of New York City on September 17, 1965, few Americans took notice — but he was not merely another immigrant. He was on a mission to introduce an ancient religion, which originated in India, into mainstream America. Before Srila Prabhupada passed away on November 14, 1977, at the age of 81, his mission proved successful. He had founded the International Society for Krishna Consciousness (ISKCON) and saw it grow into a worldwide confederation of more than 100 temples, ashrams and cultural centers.   Srila Prabhupada was born Abhay Charan De on September 1, 1896, to a pious Hindu family in Calcutta. As a youth growing up in British-controlled India, Abhay became involved with Mahatma Gandhi&#039;s civil disobedience movement to secure independence for his nation. It was, however, a 1922 meeting with a prominent scholar and religious leader, Srila Bhaktisiddhanta Sarasvati, which proved most influential on Abhay&#039;s future calling. Srila Bhaktisiddhanta was a leader in the Gaudiya Vaishnava denomination, a monotheistic tradition within the broad Hindu culture, and asked Abhay to bring the teachings of Lord Krishna to the English-speaking world. Abhay became a disciple of Srila Bhaktisiddhanta in 1933, and resolved to carry out his mentor&#039;s request. Abhay, later known by the honorific A.C. Bhaktivedanta Swami Prabhupada, spent the next 32 years preparing for his journey to west.   In 1965, at the age of sixty-nine, Srila Prabhupada travelled to New York City aboard a cargo ship. The journey was treacherous, and the elderly spiritual teacher suffered two heart attacks aboard ship. Arriving in the United States with just seven dollars in Indian rupees and his translations of sacred Sanskrit texts, Srila Prabhupada began to share the timeless wisdom of Krishna consciousness. His message of peace and goodwill resonated with many young people, some of whom came forward to become serious students of the Krishna tradition. With the help of these students, Srila Prabhupada rented a small storefront on New York&#039;s Lower East Side to use as a temple. On July 11, 1966, he officially registered his organization in the state of New York, formally founding the International Society for Krishna Consciousness. In the eleven years that followed, Srila Prabhupada circled the globe 14 times on lecture tours, bringing the teachings of Lord Krishna to thousands of people on six continents. Men and women from all backgrounds and walks of life came forward to accept his message, and with their help, Srila Prabhupada established ISKCON centers and projects throughout the world. Under his inspiration, Krishna devotees established temples, rural communities, educational institutions, and started what would become the world&#039;s largest vegetarian food relief program. With the desire to nourish the roots of Krishna consciousness in its home, Srila Prabhupada returned to India several times, where he sparked a revival in the Vaishnava tradition. In India, he opened dozens of temples, including large centers in the holy towns of Vrindavana and Mayapur.   Srila Prabhupada&#039;s most significant contributions, perhaps, are his books. He authored over 70 volumes on the Krishna tradition, which are highly respected by scholars for their authority, depth, fidelity to the tradition, and clarity. Several of his works are used as textbooks in numerous college courses. His writings have been translated into 76 languages. His most prominent works include: Bhagavad-gita As It Is, the 30-volume Srimad-Bhagavatam, and the 17-volume Sri Chaitanya-charitamrita.'),
