(14, 38, ':life-patron-iskcon-lotus-temple-nagpur.jpg', 'life-patron-iskcon-lotus-temple-nagpur.jpg'),
(14, 39, '<p>The Life Membership facility is an opportunity to become part of ISKCON&#39;s family. A.C. Bhaktivedanta Swami introduced the Life Membership program in early 70&#39;s and invited everyone across the world to take advantage of residing in ISKCON temples all over the world for a couple of days, attend spiritual programs and receive Krishna conscious association.</p>\r\n', 'The Life Membership facility is an opportunity to become part of ISKCON&#039;s family. A.C. Bhaktivedanta Swami introduced the Life Membership program in early 70&#039;s and invited everyone across the world to take advantage of residing in ISKCON temples all over the world for a couple of days, attend spiritual programs and receive Krishna conscious association.'),
(14, 40, '<p>As a Life Patron member, you will be entitled to receive the following benefits:</p>\r\n\r\n<ul>\r\n	<li>Life member is entitled for free accommodation for three days per year per centre, subject to availability and prior confirmed reservation.</li>\r\n	<li>Tax benefits under Section 80G on all donations.</li>\r\n	<li>Upon paying Rs.35,555/- you will receive a 18-volumes book set of Srimad Bhagavatam.</li>\r\n	<li>An appealing framed photo of Lord Krishna.</li>\r\n	<li>List of ISKCON centers across the world will be sent to you along with the Life Patron Card.</li>\r\n	<li>Birthday greetings for Life Member&#39;s family every year. Special pooja will be performed for the Life Member on his/her birthday.</li>\r\n</ul>\r\n', 'As a Life Patron member, you will be entitled to receive the following benefits: Life member is entitled for free accommodation for three days per year per centre, subject to availability and prior confirmed reservation. Tax benefits under Section 80G on all donations. Upon paying Rs.35,555/- you will receive a 18-volumes book set of Srimad Bhagavatam. An appealing framed photo of Lord Krishna. List of ISKCON centers across the world will be sent to you along with the Life Patron Card. Birthday greetings for Life Member&#039;s family every year. Special pooja will be performed for the Life Member on his/her birthday.'),
(17, 27, 'Susan Orlean', 'Susan Orlean'),
(17, 28, ':images.jpg', 'images.jpg'),
(17, 29, '<p>Leverage agile frameworks to provide a robust synopsis for high level overviews. Iterative approaches to corporate strategy foster collaborative thinking to further the overall value proposition. Organically grow the holistic world view of disruptive innovation via workplace diversity and empowerment.</p>\r\n', 'Leverage agile frameworks to provide a robust synopsis for high level overviews. Iterative approaches to corporate strategy foster collaborative thinking to further the overall value proposition. Organically grow the holistic world view of disruptive innovation via workplace diversity and empowerment.'),
(18, 41, 'FOOD FOR LIFE', 'FOOD FOR LIFE'),
(18, 42, 'a:0:{}', ''),
(18, 43, '<h3 class=\"text-center gxcpl-fc-orange\" style=\"text-align: center;\">yat karosi yad asnasi yaj juhosi dadasi yat<br />\r\nyat tapasyasi kaunteya tat kurusva mad-arpanam</h3>\r\n\r\n<h4 class=\"text-center\" style=\"text-align: center;\">&quot;Whatever you do, whatever you eat, whatever you offer or give away, and whatever austerities you perform&mdash;do that, O son of Kunti, as an offering to Me, &quot; explains Lord Krishna in the Bhagavad-gita.</h4>\r\n\r\n<p class=\"text-justify\">Eating food is a basic necessity of life, perhaps one of the most basic of all. Even modern science attests to the fact that we are affected physically, emotionally and mentally by the food we eat. Yet there is one more realm to food, beyond this basic understanding, that the world seems to have forgotten: its transcendental nature.</p>\r\n\r\n<p class=\"text-justify\">The Vedas give us a name for this highest perfection of food: prasadam or the mercy of God. Sri Chaitanya Mahaprabhu tells us of prasadam, &quot;Everyone has tasted these material substances before, but now these same ingredients have taken on extraordinary flavours and uncommon fragrances.&quot;</p>\r\n\r\n<p class=\"text-justify\">This unique taste and flavor of prasadam lies in its very definition. Prasadam is food that is offered to the Supreme Personality, Lord Krishna, who, in His mercy, accepts our offering and by doing so, purifies the food. Prasadam is no different from Krishna Himself and simply by eating it, we can know Krishna. Considered the perfection of vegetarianism, eating prasadam leads one to the highest state of spiritual realization.</p>\r\n\r\n<p class=\"text-justify\">Prasadam distribution, therefore, is one of the most important activities and this fact echoes through every one of the many prasadam stalls within the temple. A large team of cooks is involved in the cooking which is supported by another team which exclusively takes care of maintaining cleanliness of the kitchen premises. The items so cooked in these well maintained kitchens are offered to the Lord and then made available to the thousands of daily visitors to the temple as prasadam. A food laboratory experiments with new recipes every day, adapting the world&#39;s many cuisines to the temple&#39;s strictly Vaishnava style of cooking. With nearly 1200 well researched recipes used to prepare the food, the temple cuisine is unique, bringing in an eclectic mix of tastes and flavors to its many signature dishes. Quality and hygiene are also of utmost importance to the highly dedicated team. Regular, as well as random quality checks ensure that the best quality food is offered to the Lord.</p>\r\n\r\n<p class=\"text-justify\">By showcasing its sattvic culinary skills for people through its many prasadam stalls, the temple aims to demonstrate that anything in the vegetarian kingdom can be cooked and distributed as prasadam, including sweets, juices and cakes of a wide variety. From the most traditional food to its more modern dishes, prasadam for a variety of tastes and preferences are available for the visitor.</p>\r\n\r\n<p class=\"text-justify\">The ultimate aim is to make people eat Krishna prasadam, which nourishes spiritual intelligence. We give a variety of dishes so that people may be attracted to the food of their liking. The Higher Taste restaurant provides a fine dining experience, reviving many of ancient India&#39;s cooking techniques for the modern palate, taking one through a journey of antiquity and spirituality, all in the comfort of its elegant d&eacute;cor.</p>\r\n', 'yat karosi yad asnasi yaj juhosi dadasi yat yat tapasyasi kaunteya tat kurusva mad-arpanam &quot;Whatever you do, whatever you eat, whatever you offer or give away, and whatever austerities you perform—do that, O son of Kunti, as an offering to Me, &quot; explains Lord Krishna in the Bhagavad-gita. Eating food is a basic necessity of life, perhaps one of the most basic of all. Even modern science attests to the fact that we are affected physically, emotionally and mentally by the food we eat. Yet there is one more realm to food, beyond this basic understanding, that the world seems to have forgotten: its transcendental nature. The Vedas give us a name for this highest perfection of food: prasadam or the mercy of God. Sri Chaitanya Mahaprabhu tells us of prasadam, &quot;Everyone has tasted these material substances before, but now these same ingredients have taken on extraordinary flavours and uncommon fragrances.&quot; This unique taste and flavor of prasadam lies in its very definition. Prasadam is food that is offered to the Supreme Personality, Lord Krishna, who, in His mercy, accepts our offering and by doing so, purifies the food. Prasadam is no different from Krishna Himself and simply by eating it, we can know Krishna. Considered the perfection of vegetarianism, eating prasadam leads one to the highest state of spiritual realization. Prasadam distribution, therefore, is one of the most important activities and this fact echoes through every one of the many prasadam stalls within the temple. A large team of cooks is involved in the cooking which is supported by another team which exclusively takes care of maintaining cleanliness of the kitchen premises. The items so cooked in these well maintained kitchens are offered to the Lord and then made available to the thousands of daily visitors to the temple as prasadam. A food laboratory experiments with new recipes every day, adapting the world&#039;s many cuisines to the temple&#039;s strictly Vaishnava style of cooking. With nearly 1200 well researched recipes used to prepare the food, the temple cuisine is unique, bringing in an eclectic mix of tastes and flavors to its many signature dishes. Quality and hygiene are also of utmost importance to the highly dedicated team. Regular, as well as random quality checks ensure that the best quality food is offered to the Lord. By showcasing its sattvic culinary skills for people through its many prasadam stalls, the temple aims to demonstrate that anything in the vegetarian kingdom can be cooked and distributed as prasadam, including sweets, juices and cakes of a wide variety. From the most traditional food to its more modern dishes, prasadam for a variety of tastes and preferences are available for the visitor. The ultimate aim is to make people eat Krishna prasadam, which nourishes spiritual intelligence. We give a variety of dishes so that people may be attracted to the food of their liking. The Higher Taste restaurant provides a fine dining experience, reviving many of ancient India&#039;s cooking techniques for the modern palate, taking one through a journey of antiquity and spirituality, all in the comfort of its elegant décor.'),
(19, 44, 'ISKCON YOUTH FORUM (IYF)', 'ISKCON YOUTH FORUM (IYF)'),
(19, 45, 'a:0:{}', ''),
(19, 46, '<p class=\"text-justify\">ISKCON Youth Forum (IYF) is the youth wing of Sri Sri Radha Gopinath Temple, a branch of the International Society for Krishna Consciousness (ISKCON). IYF is aimed towards nourishing the hearts of today&#39;s youth with the sublime message of the scriptures and helping them flourish in their lives in a wholesome manner.</p>\r\n\r\n<p class=\"text-justify\">Objective</p>\r\n\r\n<ul>\r\n	<li>To establish a youth group of spiritually strong students, who are genuine practitioners and representatives of Sanatana Dharma (Krishna consciousness), who will be like beacon lights for guiding the rest of the society in spiritual life.</li>\r\n	<li>To train students in the philosophy of Krishna consciousness, its universal applicability especially to the present day generation, its profound depth along with logic &amp; reasons.</li>\r\n	<li>To train students to become preachers of Sanatana Dharma.</li>\r\n	<li>To develop Personality and build up Character of youth, to give a real meaning to their lives, to live a God-centered life of purity and dedication with love and trust amongst one another.</li>\r\n	<li>To identify the talents in youth, and dovetail their talents for the service of God.</li>\r\n	<li>To render the most noble service of `JNANA DAAN&rsquo; distributing the sublime message of Vedas through spiritual books distribution at subsidized prices for youth.</li>\r\n	<li>To scientifically present Krishna conscious philosophy through all possible mediums of communication -- Books, Notes, Video/Audio Cassettes, OHP presentations, Slide shows, Dramas, Charts, Pictures, Magazines, etc. To teach how to practice the science of Pure Love of God, which is the real goal of life, which alone can situate every living being back in his constitutional position of being the eternal servant of God in the Kingdom of God.</li>\r\n</ul>\r\n\r\n<p class=\"text-justify\">We conduct different courses, seminar and workshop training the youth to develop a perfect blend of Character and Competence.</p>\r\n\r\n<p class=\"text-justify\">Seminars offered:</p>\r\n\r\n<ul>\r\n	<li>Art of Stress Control</li>\r\n	<li>Power of Habits</li>\r\n	<li>Art of Time Management</li>\r\n	<li>3 qualities of a true leader</li>\r\n	<li>Lifestyle Management</li>\r\n	<li>Art of Harnessing Mind Power</li>\r\n	<li>Overcoming Fear</li>\r\n	<li>Positive thinking</li>\r\n	<li>Managing with hand-head-heart and many more</li>\r\n</ul>\r\n\r\n<p class=\"text-justify\">Workshops:</p>\r\n\r\n<ul>\r\n	<li>Discover yourself (DYS)</li>\r\n	<li>Leading meaningful Life</li>\r\n	<li>Positive thinker</li>\r\n	<li>Self-manager</li>\r\n	<li>Proactive leader</li>\r\n	<li>Essence of Bhagwat Gita</li>\r\n</ul>\r\n\r\n<p class=\"text-justify\">Training session include:</p>\r\n\r\n<ul>\r\n	<li>Prerna- Monthly Youth Festival</li>\r\n	<li>Weekly classes</li>\r\n	<li>Sankalpa and sphurti camps</li>\r\n	<li>Utakarsha camp</li>\r\n	<li>Yatras to Holy Pilgrimage</li>\r\n</ul>\r\n\r\n<p class=\"text-justify\">We also conduct seminars and courses in different colleges for all the interested students.</p>\r\n\r\n<p class=\"text-justify\">Colleges involved</p>\r\n\r\n<ul>\r\n	<li>VNIT</li>\r\n	<li>LIT</li>\r\n	<li>DBACER</li>\r\n	<li>YCCE</li>\r\n	<li>Raisoni</li>\r\n	<li>Ramdev Baba</li>\r\n	<li>NPTI</li>\r\n</ul>\r\n', 'ISKCON Youth Forum (IYF) is the youth wing of Sri Sri Radha Gopinath Temple, a branch of the International Society for Krishna Consciousness (ISKCON). IYF is aimed towards nourishing the hearts of today&#039;s youth with the sublime message of the scriptures and helping them flourish in their lives in a wholesome manner. Objective To establish a youth group of spiritually strong students, who are genuine practitioners and representatives of Sanatana Dharma (Krishna consciousness), who will be like beacon lights for guiding the rest of the society in spiritual life. To train students in the philosophy of Krishna consciousness, its universal applicability especially to the present day generation, its profound depth along with logic &amp; reasons. To train students to become preachers of Sanatana Dharma. To develop Personality and build up Character of youth, to give a real meaning to their lives, to live a God-centered life of purity and dedication with love and trust amongst one another. To identify the talents in youth, and dovetail their talents for the service of God. To render the most noble service of `JNANA DAAN’ distributing the sublime message of Vedas through spiritual books distribution at subsidized prices for youth. To scientifically present Krishna conscious philosophy through all possible mediums of communication -- Books, Notes, Video/Audio Cassettes, OHP presentations, Slide shows, Dramas, Charts, Pictures, Magazines, etc. To teach how to practice the science of Pure Love of God, which is the real goal of life, which alone can situate every living being back in his constitutional position of being the eternal servant of God in the Kingdom of God. We conduct different courses, seminar and workshop training the youth to develop a perfect blend of Character and Competence. Seminars offered: Art of Stress Control Power of Habits Art of Time Management 3 qualities of a true leader Lifestyle Management Art of Harnessing Mind Power Overcoming Fear Positive thinking Managing with hand-head-heart and many more Workshops: Discover yourself (DYS) Leading meaningful Life Positive thinker Self-manager Proactive leader Essence of Bhagwat Gita Training session include: Prerna- Monthly Youth Festival Weekly classes Sankalpa and sphurti camps Utakarsha camp Yatras to Holy Pilgrimage We also conduct seminars and courses in different colleges for all the interested students. Colleges involved VNIT LIT DBACER YCCE Raisoni Ramdev Baba NPTI'),
