(21, 56, '<p>Lord Chaitanya Mahaprabhu, who is Krishna Himself, started the Sankirtan movement, chanting of the holy name of Krishna in congregation.</p>\r\n\r\n<p>The name of Krishna and Krishna Himself are non-different. Krishna has invested all the powers in His holy name.</p>\r\n\r\n<p>Congregational Chanting means coming together and chanting the holy name of Lord joyfully. This given the devotees the chance to associate with the devotees and this gives the joy and happiness to all the devotees and Lord Krishna.</p>\r\n\r\n<p>Congregational chanting destroys all sinful reactions. It not only benefits the one who is chanting but all those moving as well as non-moving living entities.</p>\r\n\r\n<p>All the grate Acharyas from all the sampradaya have given utmost importance to congregational chanting of the holy name.</p>\r\n\r\n<p>To follow in the footstpes of these acharyas and to follow the instruction of Lord Chaitanya Mahaprabhu, ISKCON Nagpur also organizes the Harinam Sankirtan regularly through different areas of Nagpur.</p>\r\n\r\n<p>We invite all the people to participate in this sankirtan. During this sankirtan we make sure to spread the word of God by distributing spiritual scripture, &quot;Bhagwad Gita&quot;.</p>\r\n\r\n<h4 style=\"text-align: center;\">Sankirtan Schedule:</h4>\r\n\r\n<h4 style=\"text-align: center;\">Every Sunday Morning</h4>\r\n', 'Lord Chaitanya Mahaprabhu, who is Krishna Himself, started the Sankirtan movement, chanting of the holy name of Krishna in congregation. The name of Krishna and Krishna Himself are non-different. Krishna has invested all the powers in His holy name. Congregational Chanting means coming together and chanting the holy name of Lord joyfully. This given the devotees the chance to associate with the devotees and this gives the joy and happiness to all the devotees and Lord Krishna. Congregational chanting destroys all sinful reactions. It not only benefits the one who is chanting but all those moving as well as non-moving living entities. All the grate Acharyas from all the sampradaya have given utmost importance to congregational chanting of the holy name. To follow in the footstpes of these acharyas and to follow the instruction of Lord Chaitanya Mahaprabhu, ISKCON Nagpur also organizes the Harinam Sankirtan regularly through different areas of Nagpur. We invite all the people to participate in this sankirtan. During this sankirtan we make sure to spread the word of God by distributing spiritual scripture, &quot;Bhagwad Gita&quot;. Sankirtan Schedule: Every Sunday Morning'),
