(25, 63, 'Become A Spiritual Scientist', 'Become A Spiritual Scientist'),
(25, 64, 'a:0:{}', ''),
(25, 65, '<h4>Synopsis:</h4>\r\n\r\n<ul>\r\n	<li>I can&rsquo;t see God. Why should I believe in Him?</li>\r\n	<li>The Universe: How did it begin?</li>\r\n	<li>Is believing in the Vedas not blind faith?</li>\r\n	<li>Can we prove the existence of soul scientifically?Can I be scientific and still be spiritual?</li>\r\n	<li>Are the Vedas relevant today?</li>\r\n	<li>If God is one, why are there so many religions?</li>\r\n	<li>Is God personal or impersonal?</li>\r\n	<li>Do I need a guru? If yes, how can I choose the right guru?</li>\r\n	<li>Do higher dimensional world exist? Can we go there?</li>\r\n	<li>Reincarnation-A fact or fiction</li>\r\n	<li>Practice Mantra Meditation &ndash; The Yoga for Modern Age &amp; many more facts from Vedas......</li>\r\n</ul>\r\n\r\n<p>For more information please go through brochure.</p>\r\n\r\n<h4>Course Benefits:</h4>\r\n\r\n<ul>\r\n	<li>Teachings of Bhagavad Gita for day to day life</li>\r\n	<li>Understanding Spirituality, Philosophy &amp; Science</li>\r\n	<li>Practicing Mantra Meditation</li>\r\n	<li>Competence, Character &amp; Devotion to God</li>\r\n	<li>Personality development and character growth.</li>\r\n</ul>\r\n\r\n<h4>Course Outline:</h4>\r\n\r\n<ul>\r\n	<li>Registered Candidates will receive twice in a week by email course material or audio clip and a questionnaire.</li>\r\n	<li>Answers are to be mailed back to: vediceducation.iskcon@gmail.com.</li>\r\n	<li>Next set of course materials will be sent sooner we receive the previous paper&rsquo;s answers</li>\r\n	<li>16 course materials are to be answered in total in 2 months</li>\r\n	<li>Candidates completing the course will be felicitated with a certificate.</li>\r\n	<li>Mantra Meditation Circles will be organized after the successful completion of this course at place near to your locality</li>\r\n</ul>\r\n\r\n<h4>How to Register:</h4>\r\n\r\n<ul>\r\n	<li>Registration fee: Rs.150</li>\r\n	<li>Fill the registration form given above and approach ISKCON Nagpur (Empress city, behind Railway station) OR call us (7507545341, 9175114743) to get address of near by ISKCON activity center</li>\r\n</ul>\r\n\r\n<p><em><strong>Note:&nbsp; Kindly collect a copy of Bhagavad Gita.</strong></em></p>\r\n', 'Synopsis: I can’t see God. Why should I believe in Him? The Universe: How did it begin? Is believing in the Vedas not blind faith? Can we prove the existence of soul scientifically?Can I be scientific and still be spiritual? Are the Vedas relevant today? If God is one, why are there so many religions? Is God personal or impersonal? Do I need a guru? If yes, how can I choose the right guru? Do higher dimensional world exist? Can we go there? Reincarnation-A fact or fiction Practice Mantra Meditation – The Yoga for Modern Age &amp; many more facts from Vedas...... For more information please go through brochure. Course Benefits: Teachings of Bhagavad Gita for day to day life Understanding Spirituality, Philosophy &amp; Science Practicing Mantra Meditation Competence, Character &amp; Devotion to God Personality development and character growth. Course Outline: Registered Candidates will receive twice in a week by email course material or audio clip and a questionnaire. Answers are to be mailed back to: vediceducation.iskcon@gmail.com. Next set of course materials will be sent sooner we receive the previous paper’s answers 16 course materials are to be answered in total in 2 months Candidates completing the course will be felicitated with a certificate. Mantra Meditation Circles will be organized after the successful completion of this course at place near to your locality How to Register: Registration fee: Rs.150 Fill the registration form given above and approach ISKCON Nagpur (Empress city, behind Railway station) OR call us (7507545341, 9175114743) to get address of near by ISKCON activity center Note:  Kindly collect a copy of Bhagavad Gita.');

