  `custom_params` mediumtext,
  `searchable` int(1) DEFAULT '1',
  `class` tinytext,
  `not_active` text,
  PRIMARY KEY (`id`),
  KEY `couch_fields_index01` (`k_group`,`k_order`,`id`),
  KEY `couch_fields_Index02` (`template_id`)
