(17, 'The Library Book', 'Susan Orlean Leverage agile frameworks to provide a robust synopsis for high level overviews. Iterative approaches to corporate strategy foster collaborative thinking to further the overall value proposition. Organically grow the holistic world view of disruptive innovation via workplace diversity and empowerment. '),
(18, 'Default page for food-for-life.php * PLEASE CHANGE THIS TITLE *', 'FOOD FOR LIFE yat karosi yad asnasi yaj juhosi dadasi yat yat tapasyasi kaunteya tat kurusva mad-arpanam &quot;Whatever you do, whatever you eat, whatever you offer or give away, and whatever austerities you perform—do that, O son of Kunti, as an offering to Me, &quot; explains Lord Krishna in the Bhagavad-gita. Eating food is a basic necessity of life, perhaps one of the most basic of all. Even modern science attests to the fact that we are affected physically, emotionally and mentally by the food we eat. Yet there is one more realm to food, beyond this basic understanding, that the world seems to have forgotten: its transcendental nature. The Vedas give us a name for this highest perfection of food: prasadam or the mercy of God. Sri Chaitanya Mahaprabhu tells us of prasadam, &quot;Everyone has tasted these material substances before, but now these same ingredients have taken on extraordinary flavours and uncommon fragrances.&quot; This unique taste and flavor of prasadam lies in its very definition. Prasadam is food that is offered to the Supreme Personality, Lord Krishna, who, in His mercy, accepts our offering and by doing so, purifies the food. Prasadam is no different from Krishna Himself and simply by eating it, we can know Krishna. Considered the perfection of vegetarianism, eating prasadam leads one to the highest state of spiritual realization. Prasadam distribution, therefore, is one of the most important activities and this fact echoes through every one of the many prasadam stalls within the temple. A large team of cooks is involved in the cooking which is supported by another team which exclusively takes care of maintaining cleanliness of the kitchen premises. The items so cooked in these well maintained kitchens are offered to the Lord and then made available to the thousands of daily visitors to the temple as prasadam. A food laboratory experiments with new recipes every day, adapting the world&#039;s many cuisines to the temple&#039;s strictly Vaishnava style of cooking. With nearly 1200 well researched recipes used to prepare the food, the temple cuisine is unique, bringing in an eclectic mix of tastes and flavors to its many signature dishes. Quality and hygiene are also of utmost importance to the highly dedicated team. Regular, as well as random quality checks ensure that the best quality food is offered to the Lord. By showcasing its sattvic culinary skills for people through its many prasadam stalls, the temple aims to demonstrate that anything in the vegetarian kingdom can be cooked and distributed as prasadam, including sweets, juices and cakes of a wide variety. From the most traditional food to its more modern dishes, prasadam for a variety of tastes and preferences are available for the visitor. The ultimate aim is to make people eat Krishna prasadam, which nourishes spiritual intelligence. We give a variety of dishes so that people may be attracted to the food of their liking. The Higher Taste restaurant provides a fine dining experience, reviving many of ancient India&#039;s cooking techniques for the modern palate, taking one through a journey of antiquity and spirituality, all in the comfort of its elegant décor. '),
