(8, 'Default page for index.php * PLEASE CHANGE THIS TITLE *', ''),
(14, 'Default page for life-patron.php__globals * PLEASE CHANGE THIS TITLE *', 'Life Patron The Life Membership facility is an opportunity to become part of ISKCON&#039;s family. A.C. Bhaktivedanta Swami introduced the Life Membership program in early 70&#039;s and invited everyone across the world to take advantage of residing in ISKCON temples all over the world for a couple of days, attend spiritual programs and receive Krishna conscious association. As a Life Patron member, you will be entitled to receive the following benefits: Life member is entitled for free accommodation for three days per year per centre, subject to availability and prior confirmed reservation. Tax benefits under Section 80G on all donations. Upon paying Rs.35,555/- you will receive a 18-volumes book set of Srimad Bhagavatam. An appealing framed photo of Lord Krishna. List of ISKCON centers across the world will be sent to you along with the Life Patron Card. Birthday greetings for Life Member&#039;s family every year. Special pooja will be performed for the Life Member on his/her birthday. '),
(19, 'Default page for youth-forum.php * PLEASE CHANGE THIS TITLE *', 'ISKCON YOUTH FORUM (IYF) ISKCON Youth Forum (IYF) is the youth wing of Sri Sri Radha Gopinath Temple, a branch of the International Society for Krishna Consciousness (ISKCON). IYF is aimed towards nourishing the hearts of today&#039;s youth with the sublime message of the scriptures and helping them flourish in their lives in a wholesome manner. Objective To establish a youth group of spiritually strong students, who are genuine practitioners and representatives of Sanatana Dharma (Krishna consciousness), who will be like beacon lights for guiding the rest of the society in spiritual life. To train students in the philosophy of Krishna consciousness, its universal applicability especially to the present day generation, its profound depth along with logic &amp; reasons. To train students to become preachers of Sanatana Dharma. To develop Personality and build up Character of youth, to give a real meaning to their lives, to live a God-centered life of purity and dedication with love and trust amongst one another. To identify the talents in youth, and dovetail their talents for the service of God. To render the most noble service of `JNANA DAAN’ distributing the sublime message of Vedas through spiritual books distribution at subsidized prices for youth. To scientifically present Krishna conscious philosophy through all possible mediums of communication -- Books, Notes, Video/Audio Cassettes, OHP presentations, Slide shows, Dramas, Charts, Pictures, Magazines, etc. To teach how to practice the science of Pure Love of God, which is the real goal of life, which alone can situate every living being back in his constitutional position of being the eternal servant of God in the Kingdom of God. We conduct different courses, seminar and workshop training the youth to develop a perfect blend of Character and Competence. Seminars offered: Art of Stress Control Power of Habits Art of Time Management 3 qualities of a true leader Lifestyle Management Art of Harnessing Mind Power Overcoming Fear Positive thinking Managing with hand-head-heart and many more Workshops: Discover yourself (DYS) Leading meaningful Life Positive thinker Self-manager Proactive leader Essence of Bhagwat Gita Training session include: Prerna- Monthly Youth Festival Weekly classes Sankalpa and sphurti camps Utakarsha camp Yatras to Holy Pilgrimage We also conduct seminars and courses in different colleges for all the interested students. Colleges involved VNIT LIT DBACER YCCE Raisoni Ramdev Baba NPTI Contact details: Varun Gupta 9503927924 Vrajendra Tanaya Das 9156582299 Rahul M. M.Tech, Gold Medalist, VNIT Ankur Viswakarma Asian Paint Ltd, Sales executive (Project Sales) '),
(20, 'Default page for bhakti-vriksha.php * PLEASE CHANGE THIS TITLE *', 'BHAKTI VIRKSHA (Household Programs) Content Coming Soon '),
(21, 'Default page for harinaam-sankirtan.php * PLEASE CHANGE THIS TITLE *', 'HARINAAM SANKIRTAN Lord Chaitanya Mahaprabhu, who is Krishna Himself, started the Sankirtan movement, chanting of the holy name of Krishna in congregation. The name of Krishna and Krishna Himself are non-different. Krishna has invested all the powers in His holy name. Congregational Chanting means coming together and chanting the holy name of Lord joyfully. This given the devotees the chance to associate with the devotees and this gives the joy and happiness to all the devotees and Lord Krishna. Congregational chanting destroys all sinful reactions. It not only benefits the one who is chanting but all those moving as well as non-moving living entities. All the grate Acharyas from all the sampradaya have given utmost importance to congregational chanting of the holy name. To follow in the footstpes of these acharyas and to follow the instruction of Lord Chaitanya Mahaprabhu, ISKCON Nagpur also organizes the Harinam Sankirtan regularly through different areas of Nagpur. We invite all the people to participate in this sankirtan. During this sankirtan we make sure to spread the word of God by distributing spiritual scripture, &quot;Bhagwad Gita&quot;. Sankirtan Schedule: Every Sunday Morning '),
(22, 'Default page for sunday-feast.php * PLEASE CHANGE THIS TITLE *', 'SUNDAY FEAST Content Coming Soon '),
(23, 'Default page for bhagwad-gita-contest.php * PLEASE CHANGE THIS TITLE *', 'SCHOOL BHAGWAD GITA CONTEST Content Coming Soon '),
(24, 'DO NOT DELETE', ''),
(26, 'Default page for photo-gallery.php * PLEASE CHANGE THIS TITLE *', ''),
(25, 'Default page for spiritual-scientist.php__globals * PLEASE CHANGE THIS TITLE *', 'Become A Spiritual Scientist Synopsis: I can’t see God. Why should I believe in Him? The Universe: How did it begin? Is believing in the Vedas not blind faith? Can we prove the existence of soul scientifically?Can I be scientific and still be spiritual? Are the Vedas relevant today? If God is one, why are there so many religions? Is God personal or impersonal? Do I need a guru? If yes, how can I choose the right guru? Do higher dimensional world exist? Can we go there? Reincarnation-A fact or fiction Practice Mantra Meditation – The Yoga for Modern Age &amp; many more facts from Vedas...... For more information please go through brochure. Course Benefits: Teachings of Bhagavad Gita for day to day life Understanding Spirituality, Philosophy &amp; Science Practicing Mantra Meditation Competence, Character &amp; Devotion to God Personality development and character growth. Course Outline: Registered Candidates will receive twice in a week by email course material or audio clip and a questionnaire. Answers are to be mailed back to: vediceducation.iskcon@gmail.com. Next set of course materials will be sent sooner we receive the previous paper’s answers 16 course materials are to be answered in total in 2 months Candidates completing the course will be felicitated with a certificate. Mantra Meditation Circles will be organized after the successful completion of this course at place near to your locality How to Register: Registration fee: Rs.150 Fill the registration form given above and approach ISKCON Nagpur (Empress city, behind Railway station) OR call us (7507545341, 9175114743) to get address of near by ISKCON activity center Note:  Kindly collect a copy of Bhagavad Gita. ');

